Saber diferenciar todos os tipos de instrução é raramente necessário, mas as instruções compostas ( compound statements ) merecem atenção. Instruções compostas agrupam zero ou mais instruções em uma só. O corpo de uma função comum, que veremos mais adiante, é uma instrução composta contendo quatro instruç: int main()
{ // Início da instrução composta int x = 2; int y = 3; int z = x + y; return 0;
} // Fim da instrução composta Você verá, mais pra frente, muitos outros casos em que há a necessidade de utilizar esse tipo de instrução.

