As estruturas de controle while e for servem para repetir um bloco de código até que uma condição seja satisfeita. Este tipo específico de estrutura de controle se chama laço (loop). No exemplo abaixo, o programa pergunta se o usuário deseja aprender C++. Enquanto (while) a resposta não for s (sim) nem n (não), a mesma pergunta aparecerá para o usuário. Uma vez que o usuário der uma resposta válida, um if imprime a reação correspondente à resposta do usuário. #include <iostream> int main()
{ char answer = '\0'; while (answer != 's' && answer != 'n') { std::cout << "Você deseja aprender C++? [s/n]: "; std::cin >> answer; } if (answer == 's') { std::cout << "Esse é o espírito!\n"; } else { std::cout << "Que triste...\n"; }
} Em geral, usamos o laço while quando não existe uma definição clara de quantas vezes precisamos rodar o laço, apenas uma condição de continuidade que deve em algum momento posterior tornar-se falsa. O laço for adiciona legibilidade ao código quando temos uma inicialização e um passo que deve ser executado em toda iteração do laço. Tudo que é feito com um laço for pode também ser feito com um laço while, e vice versa. A diferença entre eles é que, em alguns casos, a leitura do código fica mais natural com um ou com outro. Ao contrário do while, o for se presta mais quando sabemos exatamente quantas vezes precisamos repetir as operações. No código abaixo, o laço for itera com valores de i = a até valor de i = b, somando 1 ao valor de i a cada iteração. Uma forma alternativa e mais compacta de escrever i = i + 1 seria escrever ++i. #include <iostream> int main()
{ int a = 0; int b = 0; std::cout << "Digite o valor de A: "; std::cin >> a; std::cout << "Digite o valor de B: "; std::cin >> b; int sum = 0; for (int i = a; i <= b; i = i + 1) { sum += i; } std::cout << "Sum [" << a << ", " << b << "] = " << sum << std::endl; return 0;
}

