Existem vários sites na internet para exercitar a prática de programação e algoritmos. Esses sites são conhecidos como "juizes online" como, por exemplo, UVa e Spoj . Nesses sites, é comum encontrar problemas com um formato bastante específico para os inputs dos dados dos desafios. Essa subseção traz um breve tutorial para iniciantes em C++, em relação a como poderia-se fazer a leitura dos dados para esses tipos de problema. Para o exercício, considere o problema PRIME1 do Spoj, copiado (e traduzido) abaixo, para referência: Peter deseja gerar todos os números primos para seu sistema. Você deve ajuda-lo. Gere todos os números primos entre dois números dados. Entrada A entrada inicia com um número t, que representa o número de testes (t <= 10). Cada uma das t próximas linhas contém dois números, m e n, separados por espaços. Saída Para cada caso de teste, escreva na tela todos os primos p onde m <= p <= n. Cada número primo deve ser escrito em uma linha diferente. Casos de teste devem ser separados por uma linha em branco. Exemplo Entrada: 2 1 10 3 5 Saída: 2 3 5 7 3 5 O objetivo aqui não é resolver o problema completamente, apenas implementar a leitura dos dados. A entrada de dados segue um padrão bem definido, conforme o exemplo acima. A primeira linha contém apenas um número, que deve ser lido na variável t. As t linhas seguintes devem conter pares de números (m, n). Conforme visto, é possível fazer a leitura dos dados a partir do std::cin. Utiliza-se, então, essa forma para fazer a leitura da variável t: #include <iostream> int main() { auto t = 0; std::cin >> t; std::cout << "CASOS DE TESTE: " << t << '\n'; return 0;
} A seguir, para fazer a leitura dos pares m e n, é possível utilizar um for com um contador de i = 0 até t. Enquanto esse contador não chegar no valor de t, lê-se um novo par de valores. Assume-se que os valores serão dois números válidos (Não é feita nenhuma verificação sobre os valores). #include <iostream> int main() { auto t = 0; std::cin >> t; std::cout << "CASOS DE TESTE: " << t << '\n'; for (auto i = 0; i < t; ++i) { auto n = 0; auto m = 0; std::cin >> n >> m; std::cout << "Processando dados: (" << n << ", " << m << ")\n"; // ... resto do código ... } return 0;
} Uma curiosidade interessante é que, no linux, é possível redirecionar o conteúdo de um arquivo texto, de forma que ele sirva de entrada para um programa. Por exemplo, digamos que você compile o arquivo acima e gere um executável chamado programa. Ao invés de executar esse programa e digitar as entradas dos dados manualmente, é possível criar um arquivo (por exemplo, input.txt) cujo conteúdo é conforme dado abaixo, e redirecionar o conteúdo desse arquivo para a entrada do programa programa, da seguinte forma: ./programa < input.txt. 2
1 10
3 5 O resultado da execução é dado abaixo. Essa é uma forma rápida de manter arquivos de teste para problemas de maratona de programação e juizes online. $ ./programa < input.txt CASOS DE TESTE: 2
Processando dados: (1, 10)
Processando dados: (3, 5)

